description:
Verenigde Staten
Thriller / Sciencefiction
98 minuten

goed

met Aaron Dean Eisenberg, J. Walter Holland en Jeffrey Damnit

Een groep schoolvrienden vindt een doodskist uit de 15de eeuw, waardoor ze de wereld kunnen zien als geest. De eerste 
avonturen die zij beleven als geesten zijn onschuldig, maar dit springt al snel om in gevaar. De vrienden zitten vast in een 
wereld van kwaad, waar zij leren dat er niet voor niets een verschil is tussen leven en dood.
